function App() {




    return (
      <div className="App">
        <h1>SMURFS! 2.0 W/ Redux</h1>
        <button onClick={()=> retreiveSmurf()}> Get Smurfs </button>
        <SmurfForm />
      </div>
    );
}

export default connect(null,{retreiveSmurf})(App);
